";s:3:"0,8";s:4:"name";s:12:"人才理念";s:7:"dirname";s:12:"rencailinian";s:8:"pdirname";s:12:"guanyuwomen/";s:5:"child";s:1:"0";s:8:"childids";s:2:"11";s:5:"thumb";s:0:"";s:5:"title";s:0:"";s:8:"keywords";s:0:"";s:11:"description";s:0:"";s:7:"content";s:24:"<p>人才理念<br/></p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"1";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:48:"http://www.jxseoer.com/guanyuwomen/rencailinian/";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:12;a:23:{s:2:"id";s:2:"12";s:6:"module";s:0:"";s:3:"pid";s:1:"0";s:4:"pids";s:1:"0";s:4:"name";s:9:"SEO服务";s:7:"dirname";s:7:"seofuwu";s:8:"pdirname";s:0:"";s:5:"child";s:1:"1";s:8:"childids";s:23:"12,13,14,15,16,17,18,19";s:5:"thumb";s:0:"";s:5:"title";s:0:"";s:8:"keywords";s:0:"";s:11:"description";s:0:"";s:7:"content";s:21:"<p>SEO服务<br/></p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"0";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:45:"http://www.jxseoer.com/index.php?c=page&id=12";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:13;a:23:{s:2:"id";s:2:"13";s:6:"module";s:0:"";s:3:"pid";s:2:"12";s:4:"pids";s:4:"0,12";s:4:"name";s:21:"SEO整站优化服务";s:7:"dirname";s:5:"seozz";s:8:"pdirname";s:8:"seofuwu/";s:5:"child";s:1:"0";s:8:"childids";s:2:"13";s:5:"thumb";s:0:"";s:5:"title";s:15:"SEO整站优化";s:8:"keywords";s:15:"SEO整站优化";s:11:"description";s:21:"SEO整站优化服务";s:7:"content";s:2546:"<p style="text-indent: 2em;">&nbsp;整站优化是网站SEO的高级应用，是更高层次的网站营销策略，整站优化服务并不以某个关键词排名为最终目的，而是完全以提升网站搜索引擎友好度为核心，通过提升网站的质量，获得更好的排序权重和搜索流量，并为最终的销售服务。 我们提供两种形式的整站优化服务，一种是以关键词排名为考核依据，一种是以流量为考核依据。 服务内容：<br/>&nbsp;&nbsp;<strong>&nbsp;&nbsp; &nbsp; 站内优化</strong><br/>&nbsp;&nbsp; &nbsp; &nbsp; 从网站架构、关键词、内容、链接、CMS系统五大方面进行分析，提供站内优化方案。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>关键词排名</strong><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 提升网站在搜索引擎上的整体排名。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>流量提升</strong><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据关键库指导进行SEO优化排名，获得精准流量，提升客户转化<br/>&nbsp;&nbsp;&nbsp;<strong>&nbsp;&nbsp; 监测维护</strong><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 对网站流量数据进行监测分析策略调整。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>选择我们的理由</strong><br/>&nbsp;&nbsp;&nbsp; &nbsp;<span style="color: rgb(255, 0, 0);">&nbsp; 白帽技术</span><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 首推SEO整站优化服务，坚持利用白帽(搜索引擎认可）的技术来服务客户，拒绝使用搜索引擎禁止的方法对网站进行SEO，让您远离被惩罚的风险。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="color: rgb(255, 0, 0);">智能选词</span><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 使用自主关键词分析平台结合客户网站数据，行业数据，帮助客户选择契合自身业务发展、投资回报最高的关键词组合，不断提升投入产出比。<br/>&nbsp;&nbsp;<span style="color: rgb(255, 0, 0);">&nbsp;&nbsp;&nbsp; SEOTcs平台</span><br/>&nbsp;&nbsp;&nbsp;&nbsp; 自主研发一站式SEO管理平台,提供一站式SEO优化管理监测服务,完成全网监测、SEO数据挖掘、SEO建模、SEO外包和网络营销渠道转化分析等。<br/>&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; <span style="color: rgb(255, 0, 0);">项目管理</span><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 出众的项目管理能力和智能在线管理平台，7*24小时监测网站的各个参数，实时预警，保证优化效果质量的最大化，保证工作进度按时完成。</p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"1";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:37:"http://www.jxseoer.com/seofuwu/seozz/";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:14;a:23:{s:2:"id";s:2:"14";s:6:"module";s:0:"";s:3:"pid";s:2:"12";s:4:"pids";s:4:"0,12";s:4:"name";s:15:"SEO顾问服务";s:7:"dirname";s:8:"seoguwen";s:8:"pdirname";s:8:"seofuwu/";s:5:"child";s:1:"0";s:8:"childids";s:2:"14";s:5:"thumb";s:0:"";s:5:"title";s:15:"SEO顾问服务";s:8:"keywords";s:15:"SEO顾问服务";s:11:"description";s:15:"SEO顾问服务";s:7:"content";s:1263:"<p>&nbsp;&nbsp;&nbsp; SEO顾问是未来企业网络营销的方向趋势，也是SEO服务的另一种体现形式。SEO顾问将帮助企业进行网站的整体架构分析，并依据数据和经验，为公司撰写定制的SEO推广执行方案，并与公司员工进行沟通并作出相应的培训。<br/>&nbsp;&nbsp;&nbsp; SEO顾问服务从根本节省了企业营销的开支，同时又能使公司的网站优化方法得到更加完美的支持，业务量得到增长。SEO顾问将成为越来越多中小型企业热衷的SEO服务方法。<br/>&nbsp;&nbsp;&nbsp;<strong> 我们的服务包括：</strong><br/>&nbsp;&nbsp;&nbsp; 1、行业竞争对手分析与研究一份<br/>&nbsp;&nbsp;&nbsp; 2、网站详细诊断报告一份<br/>&nbsp;&nbsp;&nbsp; 3、关键词研究与关键词库的建立<br/>&nbsp;&nbsp;&nbsp; 4、网站站内优化详细修改一份：包含meta优化、关键词密度优化、页面内容优化、图片优化、代码优化、内链优化、CMS优化等。<br/>&nbsp;&nbsp;&nbsp; 5、站外执行策略一份：包含外链针对策略，具体的执行计划安排<br/>&nbsp;&nbsp;&nbsp; 6、SEO效果监测执行报告<br/>&nbsp;&nbsp;&nbsp; 7、同时可协助完成内部的SEO团队建设<br/><br/><br/></p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"0";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:45:"http://www.jxseoer.com/index.php?c=page&id=14";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:15;a:23:{s:2:"id";s:2:"15";s:6:"module";s:0:"";s:3:"pid";s:2:"12";s:4:"pids";s:4:"0,12";s:4:"name";s:24:"移动搜索优化服务";s:7:"dirname";s:12:"yidongsearch";s:8:"pdirname";s:8:"seofuwu/";s:5:"child";s:1:"0";s:8:"childids";s:2:"15";s:5:"thumb";s:0:"";s:5:"title";s:24:"移动搜索优化服务";s:8:"keywords";s:24:"移动搜索优化服务";s:11:"description";s:0:"";s:7:"content";s:1187:"<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 移动营销是指依托于移动互联网进行、在移动终端呈现给用户的、以各种移动媒体形式发布产品、活动或服务的促销或品牌信息的营销方式。随着智能手机的普及，手机应用的兴起，移动互联网已成为时下投资的最新热点，毋庸置疑，它将成为发展最迅速的新领域，我们通过融合优质的移动媒体和自身资源，为客户提供全方位的移动营销整合服务。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>移动搜索优化服务内容：</strong><br/>&nbsp;&nbsp; &nbsp;&nbsp; 行业竞争对手分析报告<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 站内优化报告：URL、关键词、内容、内链（主导航、mypos导航、互链）、元素尺寸、访问速度......<br/>&nbsp;&nbsp; &nbsp;&nbsp; 以结果为导向：关键词良好展示、搜索流量的有效提升<br/>&nbsp;&nbsp; &nbsp;&nbsp; 阶段性工作报告：周报，反馈周工作进度及总结；月报，上月完成情况以及下月目标计划；.年报，整年服务结束后提供年工作总结报告，汇报相关优化策略工作以及来年建议。<br/><br/></p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"0";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:45:"http://www.jxseoer.com/index.php?c=page&id=15";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:16;a:23:{s:2:"id";s:2:"16";s:6:"module";s:0:"";s:3:"pid";s:2:"12";s:4:"pids";s:4:"0,12";s:4:"name";s:24:"口碑网络营销服务";s:7:"dirname";s:6:"koubei";s:8:"pdirname";s:8:"seofuwu/";s:5:"child";s:1:"0";s:8:"childids";s:2:"16";s:5:"thumb";s:0:"";s:5:"title";s:24:"口碑网络营销服务";s:8:"keywords";s:24:"口碑网络营销服务";s:11:"description";s:24:"口碑网络营销服务";s:7:"content";s:634:"<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 口碑网络营销是口碑营销与网络营销的有机结合。口碑营销分为线下、线上两种，而线下营销投入较大，效果监控难。而线上营销，也就是网络口碑营销，通过网络的快速转播、精准定位等优势，越来越被企业所重视。口碑网络营销包括策划专业的话题，通过百度营销、互动营销、博客营销、论坛营销、信息平台营销、B2B电商平台营销、邮件营销、QQ群营销、微博营销和微信营销等口碑营销模式，把企业品牌信息传播效果做到最大化，精准化。</p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"0";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:45:"http://www.jxseoer.com/index.php?c=page&id=16";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s:1:"0";}i:17;a:23:{s:2:"id";s:2:"17";s:6:"module";s:0:"";s:3:"pid";s:2:"12";s:4:"pids";s:4:"0,12";s:4:"name";s:18:"整合营销服务";s:7:"dirname";s:5:"seozh";s:8:"pdirname";s:8:"seofuwu/";s:5:"child";s:1:"0";s:8:"childids";s:2:"17";s:5:"thumb";s:0:"";s:5:"title";s:18:"整合营销服务";s:8:"keywords";s:18:"整合营销服务";s:11:"description";s:0:"";s:7:"content";s:1681:"<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 整合营销就是让每个营销渠道互相关联促进，相辅相成，达到 1+1 &gt; 2 的效果。它的特点不是一次性宣传，它是以事先精心布局好的不同话题为载体，把品牌精髓附加其上再进行层层推进。最后融入搜索引擎优化因素，延伸空间和时间，使精准目标用户获取产品信息的几率无限增大。在营销成本日益增高的今天，整合营销已经是必须采取的营销策略。 从最初的了解企业产品（服务）到后期的方案执行，文军信息都拥有一整套成熟体系，针对不同客户量身定制营销方案，您可以把全部精力用来经营，让江西云新帮企业最大限度的节省人力和资金投入，同时把网络营销效果最大化。我们会帮助企业量身定制最佳网络营销执行方案，帮助企业做好网络营销。 整合网络营销流程：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1、深入分析企业现状、产品（服务）特点以及行业特征；<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2、定位产品（服务）目标用户人群，多种网络营销方式，筛选网络营销推广平台；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 3、确定网站版式风格（已有网站可对网站内容、用户体验等进行优化）、用户口碑形象等；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 4、制定一站式网络营销执行草案，提交企业客户进行初步审核；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 5、签订网络营销合作协议，对草案进行修改，最终确定企业网络营销执行方案并执行；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 6、后期效果监测与效果评估。</p>";s:10:"attachment";N;s:8:"template";s:9:"page.html";s:7:"urlrule";s:1:"0";s:7:"urllink";s:0:"";s:8:"getchild";s:1:"1";s:4:"show";s:1:"1";s:3:"url";s:45:"http://www.jxseoer.com/index.php?c=page&id=17";s:7:"setting";s:32:"a:1:{s:7:\"nocache\";s:1:\"0\";}";s:12:"displayorder";s: